package hard;

import java.util.Comparator;

public class MorganAndString {

    public static String morganAndString(String a, String b) {
        int j = 0;
        int d = 0;
        StringBuilder sb = new StringBuilder();
        do {
            Character jack = a.charAt(j);
            Character daniel = b.charAt(d);
            int compare = jack.compareTo(daniel);
            if (compare < 0) {
                sb.append(jack);
                j++;
            } else if (compare > 0){
                sb.append(daniel);
                d++;
            } else {
                String aSuffix = a.substring(j);
                String bSuffix = b.substring(d);
                if (aSuffix.compareTo(bSuffix) <= 0) {
                    sb.append(jack);
                    j++;
                } else {
                    sb.append(daniel);
                    d++;
                }
            }

        } while (j != a.length() && d != b.length());
        if(j < a.length()) {
            String suffix = a.substring(j);
            sb.append(suffix);
        }
        if(d < b.length()) {
            String suffix = b.substring(d);
            sb.append(suffix);
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        String result = morganAndString("JACK", "DANIEL");
        System.out.println(result);

        result = morganAndString("ABACABA", "ABACABA");
        System.out.println(result);

        String actual = morganAndString(input_1_1, input_1_2);
        int actualLength = actual.length();
        int expectedLength = expectedOut_01.length();
        System.out.println("Actual length:" + actualLength);
        System.out.println("Expected length:" + expectedLength);
        System.out.println(actual);

    }

    private static String input_1_1 = "";
    private static String input_1_2 = "";
    private static String expectedOut_01 = "";
}
